package flouheforst.practice.problems.string;

import org.junit.Before;
import org.junit.Test;

import java.util.ArrayList;
import java.util.List;

import static org.junit.Assert.assertEquals;

public class FindAllAnagramsStringTest {
    
    FindAllAnagramsString findAllAnagramsString;
    
    @Before
    public void setUp() {
        this.findAllAnagramsString = new FindAllAnagramsString();
    }
    
    
    @Test
    public void test1() {
        String data1 = "cbaebabacd";
        String data2 = "abc";
        final List<Integer> expect = new ArrayList<>(List.of(0, 6));
        
        final List<Integer> response = findAllAnagramsString.solution(data1, data2);
        
        assertEquals(expect, response);
    }
    
    @Test
    public void test2() {
        String data1 = "abab";
        String data2 = "ab";
        final List<Integer> expect = new ArrayList<>(List.of(0, 1, 2));
        
        final List<Integer> response = findAllAnagramsString.solution(data1, data2);
        
        assertEquals(expect, response);
    }
    
    
    @Test
    public void test3() {
        String data1 = "";
        String data2 = "";
        final List<Integer> expect = new ArrayList<>(List.of(0, 10001));
        
        final List<Integer> response = findAllAnagramsString.solution(data1, data2);
        
        assertEquals(expect, response);
    }
}
